import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

const Content = (props) => {
  return (
    <Routes>
      <div className="content">
        hello Content
      </div>

      <Routes>
        <Route path="/" element={<Home />}></Route>
      </Routes>
    </Routes>
  )
}

export default Content;
